INSERT INTO `v1_103c930a7756a177b04abc5eb3e59734a86f01241e4ce78dfa5b1abe4eb898f3` VALUES (0, 0, 0.029, 101, 1, 105, 1, 122601, 1, 1, 110, 1.5, 160, "仲間と夏を楽しむ、夏海の魔法士。自分を変えたいという固い決意で、障害物を無効化して走り続ける。");
INSERT INTO `v1_103c930a7756a177b04abc5eb3e59734a86f01241e4ce78dfa5b1abe4eb898f3` VALUES (0, 1, 0.014, 102, 3, 111, 2, 122401, 0, 2, 105, 2.5, 120, "太陽よりも輝く、夏海の元気娘。　持ち前の身体能力で、どんなコースも柔軟に対応し、駆け抜ける。");
INSERT INTO `v1_103c930a7756a177b04abc5eb3e59734a86f01241e4ce78dfa5b1abe4eb898f3` VALUES (1, 0, 0.017, 103, 2, 105, 3, 122501, 0, 3, 110, 2.5, 350, "波打ち際に煌めく、夏海の剣士。　日々の鍛錬で鍛えた脚で、長い距離も速度を落とさず走り切る。");
INSERT INTO `v1_103c930a7756a177b04abc5eb3e59734a86f01241e4ce78dfa5b1abe4eb898f3` VALUES (0, 1, 0.016, 104, 3, 105, 4, 107501, 0, 4, 110, 1.5, 130, "海の幸に目がない、渚のお姫様。　『王家の装備』の力を解放し、障害物をものともせず前へと進む。");
INSERT INTO `v1_103c930a7756a177b04abc5eb3e59734a86f01241e4ce78dfa5b1abe4eb898f3` VALUES (0, 0, 0.014, 105, 1, 105, 5, 107601, 1, 5, 110, 2.5, 160, "海でも主さまをお世話する、白浜の巫女。精霊の力で自身を加速させ、誰よりも速くゴールを目指す。");
INSERT INTO `v1_103c930a7756a177b04abc5eb3e59734a86f01241e4ce78dfa5b1abe4eb898f3` VALUES (1, 0, 0.029, 106, 2, 103, 6, 107801, 0, 6, 120, 3.5, 255, "水着姿を恥じらう、ツンデレ猫娘。お得意の魔法で、対戦相手の走りを妨害し、レースを有利に進める。");
INSERT INTO `v1_103c930a7756a177b04abc5eb3e59734a86f01241e4ce78dfa5b1abe4eb898f3` VALUES (0, 0, 0.013, 107, 1, 103, 7, 110601, 1, 7, 120, 3.5, 160, "優雅に浜を駆ける、真夏のマホ姫。しゃなりしゃなりと、雅な身のこなしで障害物を跳び越えていく。");
INSERT INTO `v1_103c930a7756a177b04abc5eb3e59734a86f01241e4ce78dfa5b1abe4eb898f3` VALUES (1, 0, 0.014, 108, 2, 103, 8, 110401, 0, 8, 110, 2.5, 350, "浜の平和を守る、真夏の狼娘。　　獣人の強靭なスタミナで、レース　後半にスパートをかける。");
INSERT INTO `v1_103c930a7756a177b04abc5eb3e59734a86f01241e4ce78dfa5b1abe4eb898f3` VALUES (0, 1, 0.012, 109, 3, 100, 9, 110501, 0, 9, 105, 1.5, 130, "浜に力強く舞う、真夏の南国娘。　レースの喧噪の中でも精神を乱さず後半に大きな捲りを見せる。");
INSERT INTO `v1_103c930a7756a177b04abc5eb3e59734a86f01241e4ce78dfa5b1abe4eb898f3` VALUES (0, 0, 0.014, 110, 1, 103, 10, 115701, 1, 10, 105, 2.5, 200, "浜の事件を嗅ぎ付けた、真夏の　　名探偵。高い推理力と魔法で、的確に対戦相手の走りを乱す。");
INSERT INTO `v1_103c930a7756a177b04abc5eb3e59734a86f01241e4ce78dfa5b1abe4eb898f3` VALUES (1, 0, 0.071, 111, 2, 103, 11, 113601, 0, 11, 105, 2.5, 350, "再び鎧を脱いだ、灼熱の騎士団長。実戦で培った判断力で、瞬時にバリアを展開し、障害物を無力化する。");
INSERT INTO `v1_103c930a7756a177b04abc5eb3e59734a86f01241e4ce78dfa5b1abe4eb898f3` VALUES (0, 1, 0.014, 112, 3, 103, 12, 107901, 0, 12, 120, 1.5, 130, "水が苦手な、海辺の気まぐれ猫娘。浜に現れた美少女義賊は、対戦相手のスピードを奪いとる。");
INSERT INTO `v1_103c930a7756a177b04abc5eb3e59734a86f01241e4ce78dfa5b1abe4eb898f3` VALUES (0, 0, 0.022, 113, 2, 105, 13, 108001, 1, 13, 110, 1.5, 200, "バカンスも効率第一な、海の傭兵。レースでも最高効率を求め、どんな状況でも隙のない走りを見せる。");
INSERT INTO `v1_103c930a7756a177b04abc5eb3e59734a86f01241e4ce78dfa5b1abe4eb898f3` VALUES (0, 0, 0.031, 114, 1, 108, 14, 110301, 1, 14, 110, 2.5, 160, "真夏の太陽が良く似合う、海辺の　サレンママ。多才で器用、どんな　障害物もエレガントに越えていく。");
INSERT INTO `v1_103c930a7756a177b04abc5eb3e59734a86f01241e4ce78dfa5b1abe4eb898f3` VALUES (0, 1, 0.036, 115, 1, 105, 15, 107701, 0, 15, 110, 0.5, 130, "海に嵐を呼ぶ夏のドジっ娘メイド。日頃から災難に慣れており、多少　のトラブルには動じたりしない。");
INSERT INTO `v1_103c930a7756a177b04abc5eb3e59734a86f01241e4ce78dfa5b1abe4eb898f3` VALUES (1, 0, 0.048, 116, 2, 95, 16, 113101, 0, 16, 110, 3.5, 350, "粋な夏を愉しむ、若夏の姉御。　　流麗な身体捌きで、始・継・終と、UBを重ねるごとに、加速する。");
INSERT INTO `v1_103c930a7756a177b04abc5eb3e59734a86f01241e4ce78dfa5b1abe4eb898f3` VALUES (0, 1, 0.043, 117, 3, 105, 17, 113301, 0, 17, 105, 1.5, 130, "夏のトキメキに触れた、オタク魔法少女。多彩な魔法を操り、少しずつ他の走者の速度を落とし続ける。");
INSERT INTO `v1_103c930a7756a177b04abc5eb3e59734a86f01241e4ce78dfa5b1abe4eb898f3` VALUES (0, 1, 0.018, 118, 2, 95, 18, 113201, 0, 18, 105, 1.5, 130, "海獄に降臨せし、真夏の冥姫。　　レース後半に魔力を全解放し、　　蒼き疾風と成りて浜を駆け抜ける。");
INSERT INTO `v1_103c930a7756a177b04abc5eb3e59734a86f01241e4ce78dfa5b1abe4eb898f3` VALUES (0, 0, 0.021, 119, 2, 108, 19, 117001, 1, 19, 110, 2.5, 160, "夏の夕を火花で彩る、渚の壊し屋。『壊し屋』の異名と過激な愛情は、対戦相手にプレッシャーを与える。");
INSERT INTO `v1_103c930a7756a177b04abc5eb3e59734a86f01241e4ce78dfa5b1abe4eb898f3` VALUES (1, 0, 0.036, 120, 1, 105, 20, 113501, 0, 20, 110, 2.5, 255, "青春に生きる者を導く、夏の先生。夢へと邁進する聖母の加護が、その身をあらゆる困難から守る。");
INSERT INTO `v1_103c930a7756a177b04abc5eb3e59734a86f01241e4ce78dfa5b1abe4eb898f3` VALUES (1, 0, 0.02, 121, 3, 105, 21, 113401, 0, 21, 105, 2.5, 350, "笑顔の応援が眩しい、夏の超能力　ガール。超能力を駆使して、どんな障害物もひとっ飛びで乗り越える。");
INSERT INTO `v1_103c930a7756a177b04abc5eb3e59734a86f01241e4ce78dfa5b1abe4eb898f3` VALUES (0, 1, 0.018, 122, 1, 105, 22, 110101, 0, 22, 110, 2.5, 130, "海辺で大人の魅力を放つ、夏の　　セクシー先生。その魅力に囚われた対戦相手は、走りを乱してしまう。");
INSERT INTO `v1_103c930a7756a177b04abc5eb3e59734a86f01241e4ce78dfa5b1abe4eb898f3` VALUES (0, 0, 0.03, 123, 3, 111, 23, 110001, 1, 23, 105, 3.5, 160, "水着も絶対外さない、夏のカリスマモデル。走りのバイブスは超テンアゲで、スピードはおにやば。");
INSERT INTO `v1_103c930a7756a177b04abc5eb3e59734a86f01241e4ce78dfa5b1abe4eb898f3` VALUES (0, 1, 0.027, 124, 1, 103, 24, 117201, 0, 24, 110, 1.5, 130, "南の島も盛り上げる、真夏のアイドル。悪天候でも笑顔を絶やさず後半もリズムを上げて走り切る。");
INSERT INTO `v1_103c930a7756a177b04abc5eb3e59734a86f01241e4ce78dfa5b1abe4eb898f3` VALUES (0, 0, 0.02, 125, 2, 108, 25, 117301, 1, 25, 105, 3.5, 160, "海原に美声を響かす、渚の歌姫。　守護の賛歌と精霊の加護により、　障害物から身を守る。");
INSERT INTO `v1_103c930a7756a177b04abc5eb3e59734a86f01241e4ce78dfa5b1abe4eb898f3` VALUES (1, 0, 0.04, 126, 3, 105, 26, 117401, 0, 26, 110, 2.5, 350, "夏でも天邪鬼な、夕凪のテーラー。張り巡らされた魔法の糸で、他の走者の自由を奪う。");
INSERT INTO `v1_103c930a7756a177b04abc5eb3e59734a86f01241e4ce78dfa5b1abe4eb898f3` VALUES (1, 0, 0.009, 127, 1, 105, 27, 117101, 0, 27, 110, 3.5, 350, "向日葵が良く似合う、海辺の　　　お姉ちゃん。秘密結社の一員で、　抜群の身体能力が一番の武器。");
INSERT INTO `v1_103c930a7756a177b04abc5eb3e59734a86f01241e4ce78dfa5b1abe4eb898f3` VALUES (1, 0, 0.022, 128, 1, 105, 28, 122901, 0, 28, 120, 3.5, 255, "渚でおっとり、夏色うさぎっこ。　うさぎさんパワー全開で、ぴょん　ぴょんとコースを跳ね回る。");
INSERT INTO `v1_103c930a7756a177b04abc5eb3e59734a86f01241e4ce78dfa5b1abe4eb898f3` VALUES (0, 1, 0.028, 129, 3, 105, 29, 122801, 0, 29, 110, 2.5, 130, "無邪気さ弾ける、夏色いたずら娘。砂浜でも、いたずらの準備は万端！レースに大波乱が巻き起こる！？");
INSERT INTO `v1_103c930a7756a177b04abc5eb3e59734a86f01241e4ce78dfa5b1abe4eb898f3` VALUES (0, 0, 0.023, 130, 2, 108, 30, 122701, 1, 30, 105, 3.5, 130, "海でも真面目な、夏色優等生。　　高めた魔力を解き放ち、一瞬の内に他の走者を置き去りにする。");
